import { Card, ProgressBar } from "react-bootstrap";
import styles from './card.module.css';

interface IProps { 
    title: string;
    text: string;
    funcao?: () => void; 
}

export default function ICard ({title, text, funcao}: IProps) {
    return (
        <Card style={{ width: '18rem', textAlign: 'center', marginBottom: '20px' }} className={styles.card} onClick={funcao}>
        <Card.Body>
          <Card.Title>{title}</Card.Title>
          <Card.Text>
            tarefas: {text}
          </Card.Text>
        </Card.Body>
        <Card.Footer>
        <ProgressBar now={66.66666666666667} /> 60%
        </Card.Footer>
      </Card>
    )
}
